import './App.scss'
import ProductsPage from './products/productsPage'
import { BrowserRouter as Router, Route, Routes, Redirect } from "react-router-dom"

function App() {
	return (
		<Router>
			<Routes>
				<Route path="/" component={ProductsPage} />
			</Routes>
		</Router>
	);
}

export default App;
